import { Component } from "react";
import CharacterList from "../CharacterList";
import "./style.css";

class Character extends Component {
  render() {
    return (
      <div>
        <h1>personagens</h1>
        <div id="character">
          {this.props.name.map((crr, idx) => (
            <CharacterList key={idx} list={crr}></CharacterList>
          ))}
        </div>
      </div>
    );
  }
}
export default Character;
